.ship-input {
	width: 311px;
	height: 48px;
	background-color: #f8f8f8;
	border-radius: 8px;
	margin: 40px auto 20px;
	input {
		background-color: #f8f8f8;
		width: 100%;
		height: 100%;
		border: none;
		text-align: center;
		font-size: 15px;
		color: #919191;
	}
}
.ship-tip {
	text-align: center;
	font-size: 13px;
	color: #919191;
}
.ship-btn {
	width: 95%;
	margin: 0 auto;
	text-align: center;
	margin-top: 138.5px;
	p {
		width: 311px;
		height: 48px;
		line-height: 48px;
		background-color: #d8d8d8;
		border-radius: 24px;
		font-size: 17px;
		color: rgba(0,0,0,.4);
		margin: 0 auto;
	}
}
.ship-btn p.active {
	background-image: linear-gradient(90deg, #f7bc61 0%, #ffe3a0 100%), linear-gradient(#d8d8d8, #d8d8d8);
	color: #64442e;
}
